import styled from 'styled-components'

export const TileContainer = styled.div`
    width: 960px;
    height: 100%;
    padding
    display: flex;
    padding-bottom: 25px
    align-content: flex-start;
    flex-wrap: wrap;
`;

export const Button = styled.button`
    display: block;
    width: 40px;
    height: 40px;
    position: fixed;
    top: 80%;
    left:90%;
`;
